     local fov = 100 
 local maxTransparency = 0.1 -- TransparÃƒÂªncia mÃƒÂ¡xima dentro do cÃƒÂ­rculo (0.1 = 10% de transparÃƒÂªncia) 
 local RunService = game:GetService("RunService") 
 local UserInputService = game:GetService("UserInputService") 
