 local Cam = game.Workspace.CurrentCamera 
  
 local FOVring = Drawing.new("Circle") 
 FOVring.Visible = true 
 FOVring.Thickness = 2 
 FOVring.Color = Color3.fromRGB(128, 0, 128) -- Cor roxa 
 FOVring.Filled = false 
 FOVring.Radius = fov 
 FOVring.Position = Cam.ViewportSize / 2 
 FOVring.Transparency = 0.1 -- TransparÃƒÂªncia inicial igual ao segundo script 
  
 local function updateDrawings() 
     local camViewportSize = Cam.ViewportSize 
     FOVring.Position = camViewportSize / 2 
 end 
  
 local function onKeyDown(input) 
     if input.KeyCode == Enum.KeyCode.Delete then 
         RunService:UnbindFromRenderStep("FOVUpdate") 
         FOVring:Remove() 
     end 
 end 
  
 UserInputService.InputBegan:Connect(onKeyDown) 
  
 local function lookAt(target) 
     local lookVector = (target - Cam.CFrame.Position).unit 
     local newCFrame = CFrame.new(Cam.CFrame.Position, Cam.CFrame.Position + lookVector) 
     Cam.CFrame = newCFrame 
 end 
  
 local function calculateTransparency(distance) 
     -- Ajuste a transparÃƒÂªncia com base na distÃƒÂ¢ncia do centro do cÃƒÂ­rculo 
     local maxDistance = fov -- A distÃƒÂ¢ncia mÃƒÂ¡xima do centro do cÃƒÂ­rculo 
     local transparency = (1 - (distance / maxDistance)) * maxTransparency 
     return transparency 
 end 
  
 local function getClosestPlayerInFOV(trg_part) 
     local nearest = nil 
     local last = math.huge 
     local playerMousePos = Cam.ViewportSize / 2 
     local localPlayer = Players.LocalPlayer 
     local localPlayerTeam = localPlayer.Team 
  
     for _, player in ipairs(Players:GetPlayers()) do 
         if player ~= localPlayer then 
             local part = player.Character and player.Character:FindFirstChild(trg_part) 
             if part then 
                 local ePos, isVisible = Cam:WorldToViewportPoint(part.Position) 
                 local distance = (Vector2.new(ePos.x, ePos.y) - playerMousePos).Magnitude 
  
                 -- Adicione uma verificaÃƒÂ§ÃƒÂ£o de equipe aqui 
                 if isVisible and distance < fov and player.Team ~= localPlayerTeam then 
                     if distance < last then 
                         last = distance 
                         nearest = player 
                     end 
                 end 
             end 
         end 
     end 
  
     return nearest 
 end 
  
